import { Component } from 'react'
import React from 'react';
import axios from 'axios'
import { Link } from "react-router-dom";
import './css/Home.css'
import { Tooltip, Grid, Card} from '@material-ui/core';


export default class Home extends Component {
    state = {
        reg: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const reg = res.data;
                this.setState({ reg });
            })
    }

    render() {
        return (
            <div >  
                <Grid container className="contenedoPronGeneral">
                    <Card className='main'>
                    {this.state.reg.map((item) => {
                        return (
                            <div key={item.region_id} >
                                <Link to={"/region/" + item.region_id} >
                                    <Tooltip title={item.region} interactive>
                                        <img
                                            className='regionesChile'
                                            style={item.css}
                                            src={item.img}
                                            alt={item.region}
                                         />
                                    </Tooltip>
                                </Link>
                            </div>
                        )
                    })}
                    </Card>
                    <Card item xs={8}>
                        <h1>Hola</h1>
                    </Card>
                        </Grid>

                
            </div>
        )
    }
}
